import React from "react";
import "../App.css";
const Hero = () => {
  return (
    <div>
      <div className="flex pt-14 flex-col md:flex-row">
        {/* First Part */}
        <div className="w-full md:w-1/3 p-4 bg-yellow-300">
          <p className="herotext">Where Convinience Meets Comfort</p>
        </div>

        {/* Second Part */}
        <div className="w-full md:w-1/3 p-4">
          <img src="images/Hero.jpg" alt="heroimage" className="rounded-full" />
        </div>

        {/* Third Part */}
        <div className="w-full md:w-1/3 p-4">
          <div className="flex flex-col">
            <div className="mb-4">
              <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
                Button 1
              </button>
            </div>
            <div className="mb-4">
              <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
                Button 2
              </button>
            </div>
            <div>
              <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
                Button 3
              </button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Hero;
